// frontend/src/components/Apod.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
    Button,
    Container,
    TextField,
    Typography,
    Card,
    CardMedia,
    CardContent,
    Snackbar,
    Grid,
} from '@mui/material';
import { motion } from 'framer-motion';

const Apod = () => {
    const [apodData, setApodData] = useState(null);
    const [date, setDate] = useState('');
    const [error, setError] = useState('');

    const fetchApodData = async (date) => {
        setError('');
        const today = new Date().toISOString().split('T')[0];

        // Prevent fetching data for future dates
        if (date > today) {
            setError('Please select a date that is today or in the past.');
            return;
        }

        try {
            const response = await axios.get(`http://localhost:5004/apod?date=${date}`);
            setApodData(response.data);
        } catch (err) {
            setError('Error fetching APOD data.');
        }
    };

    const handleDateChange = (e) => {
        setDate(e.target.value);
    };

    const handleFetchClick = () => {
        fetchApodData(date);
    };

    useEffect(() => {
        const today = new Date().toISOString().split('T')[0];
        fetchApodData(today); // Fetch today's APOD on component mount
    }, []);

    const today = new Date().toISOString().split('T')[0];

    return (
        <Container sx={{ textAlign: 'center', padding: '40px' }}>
            <Typography variant="h3" gutterBottom>Astronomy Picture of the Day</Typography>
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', marginBottom: '20px' }}>
                <TextField
                    type="date"
                    value={date}
                    onChange={handleDateChange}
                    inputProps={{ max: today }} // Disable future dates
                    sx={{ marginRight: '25px', width: '200px' }} // Set width for input field
                />
                <motion.div
                    whileHover={{ scale: 1.05, boxShadow: '0px 0px 12px rgba(255, 255, 255, 0.8)' }} // Button hover animation
                    whileTap={{ scale: 0.95 }} // Button press animation
                >
                    <Button variant="contained" color="primary" onClick={handleFetchClick} sx={{ width: '250px' }}> {/* Match button width */}
                        Fetch for Selected Date
                    </Button>
                </motion.div>
            </div>

            {error && (
                <Snackbar
                    open={Boolean(error)}
                    autoHideDuration={6000}
                    message={error}
                    onClose={() => setError('')}
                />
            )}

            {apodData && (
                <motion.div
                    initial={{ opacity: 0, scale: 0.8 }} // Scale down on initial render
                    animate={{ opacity: 1, scale: 1 }} // Scale to original size
                    exit={{ opacity: 0, scale: 0.8 }} // Scale down when unmounted
                    transition={{ duration: 0.5 }}
                >
                    <Card sx={{ marginTop: '20px', padding: '20px', boxShadow: 5, borderRadius: '15px' }}>
                        <CardMedia
                            component="img"
                            height="600" // Increased height for a larger image
                            image={apodData.url}
                            alt={apodData.title}
                            sx={{ borderRadius: '15px', transition: 'transform 0.5s' }} // Rounded corners and transition
                            whileHover={{ transform: 'scale(1.05)' }} // Image hover effect
                        />
                        <CardContent>
                            <Typography variant="h4" sx={{ marginBottom: '10px' }}>{apodData.title}</Typography>
                            <Typography variant="subtitle1" sx={{ marginBottom: '10px' }}>{apodData.date}</Typography>
                            <Typography variant="body1" sx={{ marginBottom: '20px' }}>{apodData.explanation}</Typography>
                            {apodData.hdurl && (
                                <motion.div
                                    whileHover={{ scale: 1.05, boxShadow: '0px 0px 12px rgba(255, 255, 255, 0.8)' }} // Button hover animation
                                    whileTap={{ scale: 0.95 }} // Button press animation
                                >
                                    <Button variant="outlined" href={apodData.hdurl} target="_blank" rel="noopener noreferrer">
                                        View HD Image
                                    </Button>
                                </motion.div>
                            )}
                        </CardContent>
                    </Card>
                </motion.div>
            )}
        </Container>
    );
};

export default Apod;
